  Code = "class Solution:\n    def generateKey(self, num1: int, num2: int, num3: int) -> int:\n        res = 0\n        cnt = 0\n        while num1 > 0 and num2 > 0 and num3 > 0:\n            res += min(num1 % 10, num2 % 10, num3 % 10) * (10 ** cnt)\n            cnt += 1\n            num1 //= 10\n            num2 //= 10\n            num3 //= 10\n        return res"
